// src/components/WhiskyList.tsx
import React, { useEffect, useState } from 'react';
import WhiskyCard from './WhiskyCard';
import axios from 'axios';

interface Whisky {
  id: number;
  name: string;
  image: string;
  region: string;
}

const WhiskyList: React.FC = () => {
  const [whiskies, setWhiskies] = useState<Whisky[]>([]);

  useEffect(() => {
    axios.get('/api/whiskies')
      .then(response => {
        setWhiskies(response.data);
      })
      .catch(error => {
        console.error('There was an error fetching the whiskies!', error);
      });
  }, []);

  return (
    <div className="whisky-list">
      {whiskies.map(whisky => (
        <WhiskyCard key={whisky.id} whisky={whisky} />
      ))}
    </div>
  );
};

export default WhiskyList;
